import { Container } from "react-bootstrap";
function Footer() {
  return (
    <>
      <section
        style={{
          bottom: "0",
          width: "100%",
          backgroundColor: "#2C3539",
          color: "#fff",
          padding: "10px",
        }}
      >
        <p
          style={{
            fontSize: "1rem",
            textAlign: "center",
          }}
        >
          Aviliable locations of car services:
        </p>
        <Container
          style={{
            display: "flex",
            justifyContent: "space-between",
            fontSize: "0.8rem",
            marginTop: "20px",
            marginBottom: "25px",
          }}
        >
          <p>Delhi</p>
          <p>Mumbai</p>
          <p>Hyderabad</p>
          <p>Chennai</p>
          <p>Banglore</p>
        </Container>
        <Container>
          <p>Designed and Developed by Ashish</p>
        </Container>
        <Container>
          <a
            href="https://portfolio-polu-sai-ashish.web.app/"
            target="_blank"
            rel="noreferrer"
            style={{
              textDecoration: "none",
              color: "white",
            }}
          >
            Know or Contact Me?
          </a>
        </Container>
      </section>
    </>
  );
}
export default Footer;
